import { gql } from 'apollo-boost';

const PLAYER_QUERY = gql`
query PlayerId($searchStr: String!){
  getPlayer(searchStr: $searchStr){
    searchStr
    name
    id
  }
}
`;

const PLAYER_ID_QUERY = gql`
  query getPlayer($name: String!) {
    getPlayerId(name: $name) @client
  }
`;

type setPlayerQueryObj = {
  searchStr: String,
};

type getPlayerIdQueryObj = {
  name: string
}

export const resolvers = {

};

export default resolvers;
